[{"content":"# Componenta","type":"text","id":"2iw"},{"content":"import React, { useState } from 'react';\r\n\r\nfunction CounterButton() {\r\n  // State pentru counter, inițializat cu 0\r\n  const [count, setCount] = useState(0);\r\n\r\n  // Funcție pentru incrementarea counter-ului\r\n  const incrementCount = () => {\r\n    setCount(count + 1);\r\n  };\r\n\r\n  return (\r\n    <div style={{ textAlign: 'center', marginTop: '50px' }}>\r\n      <h1>Counter: {count}</h1>\r\n      <button \r\n        onClick={incrementCount} \r\n        style={{\r\n          padding: '10px 20px',\r\n          fontSize: '16px',\r\n          cursor: 'pointer'\r\n        }}\r\n      >\r\n        Click Me!\r\n      </button>\r\n    </div>\r\n  );\r\n}\r\n\r\n","type":"code","id":"s94"},{"content":"function App() {\r\n  return (\r\n    <div>\r\n      <CounterButton />\r\n    </div>\r\n  );\r\n}\r\n\r\nshow(<App/>)","type":"code","id":"vof"}]